__NUXT_JSONP__("/drugs/Pomegranate_Juice", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A natural juice isolated from the fruit of the plant Punica granatum with antioxidant, potential antineoplastic, and chemopreventive activities.  Pomegranate juice contains flavonoids which promote differentiation and apoptosis in tumor cells by down-regulating vascular endothelial growth factor (VEGF) and stimulating migration inhibitory factor (MIF), thereby inhibiting angiogenesis. The flavonoids in pomegranate juice also scavenge reactive oxygen species (ROS) and, in some cell types, may prevent ROS-mediated cell injury and death.",fdaUniiCode:"99S671U9KB",identifier:"C26665",preferredName:c,semanticType:"Food",subclassOf:["C71952"],synonyms:["POMEGRANATE JUICE",c]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FPomegranate_Juice",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Pomegranate_Juice","Pomegranate Juice","2021-10-30T13:38:13.043Z")));